import {useEffect,useState} from "react";
import axios from "axios";

const Example = () => {
  const [users,setUsers] = useState([]);
  useEffect(()=>{
    axios.get('http://localhost:3003/user').then((res)=>{
      setUsers(res.data);
    })
  })
};

export default Example;
